const EbGaramondRegular = `@font-face { font-family: 'EB Garamond'; font-style: normal; font-weight: 400; src: local('EB Garamond Regular'), local('EBGaramond-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const EbGaramond500 = `@font-face { font-family: 'EB Garamond'; font-style: normal; font-weight: 500; src: local('EB Garamond Medium'), local('EBGaramond-Medium'), url('data:font/woff2;base64,') format('woff2'); }`;
const EbGaramondItalic = `@font-face { font-family: 'EB Garamond'; font-style: italic; font-weight: 400; src: local('EB Garamond Italic'), local('EBGaramond-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
